<?php
$a = "eval(str_rot13(convert_uudecode(str_rot13(base64_decode('')))));";
function decodephp($a)
{
    $max_level = 300; //最大层数
    for ($i = 0; $i < $max_level; $i++) {
        ob_start();
        eval(str_replace('eval', 'echo', $a));
        $a = ob_get_clean();
        if (strpos($a, 'eval(str_rot13(convert_uudecode(str_rot13(base64_decode') === false) {
            return $a;
        }
    }
}
echo decodephp($a);